posts.description:
Hiking is where it all started for me, it’s how I found my love for the outdoors, and is still one of my favourite ways to spend my time. Walking really is one of the healthiest forms of exercise and with summer giving us plenty of long, sunny days to enjoy the great outdoors, there are so many reasons how it can benefit your health and wellbeing. .
@pushdoctor give you 15 reasons why walking is one of the healthiest ways to exercise, go take a look and see how it can change your life (follow the link in my bio).
.

Woodland walks...
.
One of the most enjoyable walks I've been on in the last few months. Its something about the isolation, and wildness of the landscape; the strong smell of pine, the fresh damp in the air as the cloud rolls over, and the eerie silence of the dark woodland.
.
